You must convert a natural-language cancel time into an ISO 8601 timestamp in America/Toronto, automatically handling Daylight Saving Time. The input may be "tomorrow at 11am" or already a valid timestamp.

Return exactly one JSON object and nothing else, in this format:

{"convertedDate":"<ISO-8601-timestamp-with-offset>"}

If the input is missing or invalid, use: "convertedDate": null.

Example: {"convertedDate":"2025-08-12T11:00:00-04:00"}

